import React, { useState } from 'react';
import './App.css';
import Navbar from './components/CounsellorComponents/Navbar';
import Home from './components/CounsellorComponents/Pages/Home';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Appointment from './components/CounsellorComponents/Pages/Appointment';
import Session from './components/CounsellorComponents/Pages/Session';
import StudentList from './components/CounsellorComponents/Pages/StudentList';
import Profile from './components/CounsellorComponents/Pages/Profile'

function App() {

  const [isCounsellor, setIsCounsellor] = useState(true)
  const [isStudent, setIsStudent] = useState(false)

  return (
    <>
      <Router>
        <Navbar />
        <Switch>
          <Route path='/' exact component={Home} />
          <Route path='/appointment' component={Appointment} />
          <Route path='/session' component={Session} />
          <Route path='/students' component={StudentList} />
          <Route path='/profile' component={Profile} />
        </Switch>
      </Router>
    </>
  );
}

export default App;
